choices.text:
parser.parseArray(componentType, array, fieldName);
if (componentClass == byte.class) {
    byte[] bytes = new byte[array.size()];
    for (int i = 0; i < bytes.length; ++i) {
        Object val = array.get(i);
        if (val == null) {
            bytes[i] = 0;
        } else {
            bytes[i] = TypeUtils.castToByte(val);
        }
    }
    return (T) bytes;
}

